import sys


def main():
    n = int(sys.stdin.readline().strip())
    colors = []
    for i in range(n):
        colors.append(sys.stdin.readline().strip().lower())
    missing = 6 - len(colors)
    if missing == 0:
        print(0)
    else:
        print(missing)
        for i in range(missing):
            if i == 0:
                print("Space")
            elif i == 1:
                print("Time")
            elif i == 2:
                print("Power")
            elif i == 3:
                print("Soul")
            elif i == 4:
                print("Reality")
            elif i == 5:
                print("Mind")


